$font-size-xl: 2em;
$font-size-lg: 1.5em;
$font-size-med: 1.1em;
$font-size-base: 1em;
$font-size-sm: 0.85em;
$font-size-xs: 0.7em;
$font-size-xxs: 0.7rem;


//----------------------------------------------
