//----------------------------------------------
// Smallest phone
$mq-xsmall: 22em;
// Phone
$mq-sm: 32em;
// Tablet
$mq-med: 54em;
// Laptop
$mq-lg: 67em;
// Past laptop
$mq-xl: 94em;
// Mid-size monitor
$mq-xxl: 115em;
// Thunderbold goes to 157em
$mq-xxxl: 130em;


//----------------------------------------------
// Grid
//----------------------------------------------
$grid-width:          92%;
$grid-width-lg:       88%;
$grid-max-width-sm:   41em;
$grid-max-width:      46em;
$grid-max-width-med:  52em;
$grid-max-width-lg:   62em;
$grid-max-width-xl:   90%;
$grid-max-width-xxl:  95%;

//----------------------------------------------
// Spacings (pad/margin)
//----------------------------------------------
$pad-scale: 1em;
$pad-xxs:   $pad-scale / 2;
$pad-xs:    $pad-scale;
$pad-sm:    $pad-xs + $pad-xs;
$pad-med:   $pad-sm + $pad-xs;
$pad:       $pad-sm + $pad-sm;
$pad-lg:    $pad + $pad-sm;
$pad-xl:    $pad + $pad;
$pad-col:   $pad-xs;
$pad-col-med: $pad-sm;
$pad-col-lg: $pad-med;

//----------------------------------------------
// Global Sizing Elements
//----------------------------------------------
$header-height-sm: 3.5em;
$header-height-lg: 4em;

//----------------------------------------------
// Measures
//----------------------------------------------
$measure-sm: 23em;
$measure-med: 30em;

//----------------------------------------------
// Colors
//----------------------------------------------
$color-blue:       #6c77f7;
$color-green:      #58ff9c;
$color-alpha:      $color-blue;
$color-beta:       $color-blue;
$color-white:      #fff;
