$color-grey-mid:       #645853;
$color-grey-dark:     #111;
$color-warning:       #c43a31;
$color-success:       #1ABC9C;


//----------------------------------------------
// Base UI
//----------------------------------------------
$base-border-radius: 0px;
$base-border-width:  1px;

//----------------------------------------------
// Forms
//----------------------------------------------
$form-border-width: 1px;
$form-color: $color-grey-dark;
$form-color-placeholder: $color-grey-mid;
$form-color-border: $color-grey-light;
$form-pad:  $pad-xs;

//----------------------------------------------
