    font-size: 1.1em;
    color: $color-white;
  }

  &__controls {
    display: flex;
    align-items: center;
  }

  &__fstoggle {
    padding-right: 0.5em;
    svg {
      height: 1em;

      path{
        fill: #fff;
        transition: fill 0.4s ease;
      }
    }

    &:hover svg path {
      fill: $color-alpha;
    }

    @media (max-width: $mq-med) {
      display: none;
    }
  }

  &__prev, &__next {
    padding-left: 1em;
    color: #fff;
    transition: color 0.5s ease;

    &:hover {
      color: $color-alpha;
    }

    i {
      font-size: 1.25em;
      font-style: normal;
      text-decoration: none;
    }
  }
